ESX.RegisterServerCallback("handy:getData", function(source, cb)
    local xPlayer = ESX.GetPlayerFromId(source)
	MySQL.Async.fetchAll('SELECT * FROM users WHERE `identifier` = @identifier', {['@identifier'] = xPlayer.identifier}, function(result)
		if result[1] ~= nil then

			local data = {
				vorname = result[1].firstname,
                nachname = result[1].lastname,
                level = result[1].level,
                id = xPlayer.source,
                team = xPlayer.job.label,
                nummer = result[1].phone,
                --krankenversicherung = result[1].versicherung
			}
			cb(data)
		end
	end)
end)
